import { Dropdown } from "react-bootstrap";
import dropdown from "./dropdown";

const menuitems = ({ items }) => {
    return (
        <li>
            {items.submenus ? (
                <>
                    <button type="button" aria-haspopup="menu">
                        {items.title}{''}
                    </button>
                    <dropdown submenus={items.submenus}/>
                </>
            ) : (
                <a href={items.url}>{items.title}</a>
            )}
        </li>
    );
};
